import React, { useState, useEffect } from 'react';

const Orders = () => {
  const [orders, setOrders] = useState([]); // Danh s√°ch ƒë∆°n h√†ng
  const [currentPage, setCurrentPage] = useState(0); // Trang hi·ªán t·∫°i
  const [totalPages, setTotalPages] = useState(0); // T·ªïng s·ªë trang
  const [pageSize, setPageSize] = useState(5); // S·ªë ph·∫ßn t·ª≠ m·ªói trang

  useEffect(() => {
    fetchOrders();
  }, [currentPage, pageSize]);

  const fetchOrders = async () => {
    try {
      const response = await fetch(
        `/api/orders?page=${currentPage}&size=${pageSize}&sort=createAt,desc`
      );
      const data = await response.json();
      setOrders(data.content);
      setTotalPages(data.totalPages);
    } catch (error) {
      console.error('Error fetching orders:', error);
    }
  };

  const handlePageChange = (page) => {
    if (page >= 0 && page < totalPages) {
      setCurrentPage(page);
    }
  };

  return (
    <div style={styles.container}>
      <h2 style={styles.header}>üì¶ Danh S√°ch ƒê∆°n H√†ng</h2>
      <table style={styles.table}>
        <thead>
          <tr style={styles.tableHeader}>
            <th>ID</th>
            <th>T·ªïng Ti·ªÅn</th>
            <th>Tr·∫°ng Th√°i</th>
            <th>Ng√†y T·∫°o</th>
            <th>Thanh To√°n</th>
          </tr>
        </thead>
        <tbody>
          {orders.map((order) => (
            <tr key={order.id} style={styles.tableRow}>
              <td>{order.id}</td>
              <td>{order.totalAmount}</td>
              <td>{order.orderStatus}</td>
              <td>{new Date(order.createAt).toLocaleDateString()}</td>
              <td>
                {order.statusPayment === 1 ? (
                  <span style={styles.paymentSuccess}>ƒê√£ Thanh To√°n</span>
                ) : (
                  <span style={styles.paymentPending}>Ch∆∞a Thanh To√°n</span>
                )}
              </td>
            </tr>
          ))}
        </tbody>
      </table>

      {/* Ph√¢n Trang */}
      <div style={styles.pagination}>
        <button
          style={styles.pageButton}
          onClick={() => handlePageChange(currentPage - 1)}
          disabled={currentPage === 0}
        >
          ‚¨ÖÔ∏è Tr∆∞·ªõc
        </button>
        <span style={styles.pageInfo}>
          Trang {currentPage + 1} / {totalPages}
        </span>
        <button
          style={styles.pageButton}
          onClick={() => handlePageChange(currentPage + 1)}
          disabled={currentPage + 1 === totalPages}
        >
          Ti·∫øp ‚û°Ô∏è
        </button>
      </div>
    </div>
  );
};

// üé® Styles (Inline CSS)
const styles = {
  container: {
    margin: '20px auto',
    padding: '20px',
    maxWidth: '900px',
    border: '1px solid #ccc',
    borderRadius: '8px',
    backgroundColor: '#f0f4f8'
  },
  header: {
    textAlign: 'center',
    marginBottom: '20px',
    fontSize: '24px',
    fontWeight: 'bold',
    color: '#1f4e79'
  },
  table: {
    width: '100%',
    borderCollapse: 'collapse',
    marginBottom: '20px',
    backgroundColor: '#ffffff'
  },
  tableHeader: {
    backgroundColor: '#1f4e79',
    color: '#ffffff',
    textAlign: 'left'
  },
  tableRow: {
    borderBottom: '1px solid #e0e0e0',
    backgroundColor: '#ffffff'
  },
  paymentSuccess: {
    color: '#28a745',
    fontWeight: 'bold'
  },
  paymentPending: {
    color: '#dc3545',
    fontWeight: 'bold'
  },
  pagination: {
    display: 'flex',
    justifyContent: 'center',
    alignItems: 'center',
    gap: '10px'
  },
  pageButton: {
    padding: '8px 12px',
    cursor: 'pointer',
    border: '1px solid #1f4e79',
    borderRadius: '4px',
    backgroundColor: '#1f4e79',
    color: '#ffffff',
    fontWeight: 'bold'
  },
  pageButtonDisabled: {
    backgroundColor: '#ccc',
    cursor: 'not-allowed'
  },
  pageInfo: {
    fontWeight: 'bold',
    color: '#1f4e79'
  }
};

export default Orders;
